description:
【財布 長財布 二つ折り さいふ レザー ブランド おすすめ サイフ ランキング 人気】<br>
MOMOアコーディオンウォレットシリーズの原点にして頂点。<br>
全25の収納ポケットとアコーディオンデザインでハンドバック級の収納力を実現致しました。<br>
通帳も入る深さで銀行などへ行く時もこのお財布1つで済んじゃいます。<br>
また、サービス券や会員証なども折らずにきっちり収納でき、使用する際にクシャクシャ…なんてこともなくなります。<br> 
全11色のカラーバリエで自分に合ったカラーを選ぶことができるのも嬉しいですね。<br><br>
◆素材◆<br>
牛革、合皮<br><br>
◆本体サイズ◆<br>
約　W190×H105×D40mm<br><br> 
◆仕様◆<br>
カードポケット×16・札入れ(ポケット)×7・ラウンドファスナー内小銭入れ×2(仕切り)
<br><br>
※現物に近い色が出る様に写真を撮っておりますが、多少濃く見えたり、薄く見えたりする場合がございます。<br>
新品未使用品ですが、商品の性質や構造上により、どうしても小さい傷などが生じる場合が御座います。<br>   <img src="http://image.rakuten.co.jp/auc-kazzu/cabinet/01565735/01849602/imgrc0067427713.jpg"><br>　<br>
